import React ,{Component } from 'react';
import {  NavLink, Link  } from "react-router-dom";
import { Nav, Navbar} from 'react-bootstrap';
import * as actions from './store/actions/auth'



export class Navigation extends Component{
    render(){
        if(actions.tokenConvertor(localStorage.getItem('token'))){
        return(
            <Navbar className='NavBar'>
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav>
                <NavLink exact to="/" activeClassName="NavBarItem--Active" className="NavBarItem">Home</NavLink>
                <NavLink to="/Download" activeClassName="NavBarItem--Active" className="NavBarItem">Download</NavLink>
                <NavLink to="/sign-up" activeClassName="NavBarItem--Active" className="NavBarItem" hidden={actions.tokenConvertor(localStorage.getItem('token'))? true : false}>Sign Up</NavLink>
                <NavLink to="/sign-in" activeClassName="NavBarItem--Active" className="NavBarItem" hidden={actions.tokenConvertor(localStorage.getItem('token'))? true : false}>Sign In</NavLink>
                <Link to="/" className="NavBarItem-LogOut" hidden={actions.tokenConvertor(localStorage.getItem('token'))? false : true} onClick={actions.logout} >Log Out</Link>
                </Nav>
                </Navbar.Collapse>
            </Navbar>
        )}
        else{
        return(
            <Navbar className='NavBar'>
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav>
                <NavLink exact to="/" activeClassName="NavBarItem--Active" className="NavBarItem">Home</NavLink>
                <NavLink to="/Download" activeClassName="NavBarItem--Active" className="NavBarItem">Download</NavLink>
                <NavLink to="/sign-up" activeClassName="NavBarItem--Active" className="NavBarItem" hidden={actions.tokenConvertor(localStorage.getItem('token'))? true : false}>Sign Up</NavLink>
                <NavLink to="/sign-in" activeClassName="NavBarItem--Active" className="NavBarItem" hidden={actions.tokenConvertor(localStorage.getItem('token'))? true : false}>Sign In</NavLink>
                <Link to="/" className="NavBarItem-LogOut" hidden={actions.tokenConvertor(localStorage.getItem('token'))? false : true} onClick={actions.logout} >Log Out</Link>
                </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
        }
    }

}

export default Navigation;
